My first time at the booth, and my last time. 5 years apart. 

Thank you Elle, I’ve loved being you. And thank you to everyone who had a hand in making these movies what they are. The Kissing Booth 3 is now streaming on Netlfix. ❤️ The end of an era, excuse me while I go sob in a corner somewhere.

